searchSites[searchSites.length - 1].searchURL = "http://www.youtube.com/results?search_query=" + QUERY_TERM + SCRIPT_URL_REF;
searchSites[searchSites.length - 1].buttonText = "YouTube Search";

//Add custom sites below this line (Additional Sites: http://userscripts.org/topics/43252)

//Add custom sites above this line

//The for loop below runs through each site in the array and checks to see if a Greasemonkey API variable has been
//stored for that particular site. If it has, it retrieves the value mapped to the key and sets the active status
//of that site to the value. Otherwise it creates the key and maps true as the value.
//The second if statement in the loop creates a Greasemonkey API menu. This menu allows users to turn search sites ON and OFF.
//Clicking the menu will turn the site OFF if ON and ON if OFF and will also reload the webpage you're currently on so the changes can be
//seen in the menu.
for (i = 0; i < searchSites.length; i++)
{
	var activeValue = GM_getValue(searchSites[i].buttonText);
	
	if (activeValue == NULL_VALUE)
	{
		GM_setValue(searchSites[i].buttonText, true);
		activeValue = true;
	}
	else
	{
		searchSites[i].active = activeValue;
	}
	
	if (activeValue == true)
	{
		GM_registerMenuCommand(searchSites[i].buttonText + ": On", function(i){return function(){GM_setValue(searchSites[i].buttonText, false); window.location.reload();}}(i));
	}
	else
	{
		GM_registerMenuCommand(searchSites[i].buttonText + ": Off", function(i){return function(){GM_setValue(searchSites[i].buttonText, true); window.location.reload();}}(i));
	}
}

//Retrieves page elements such as logo, search box, buttons and search option radio buttons
var homepageLogo = document.getElementById(LOGO_ID);
var searchBox = document.getElementsByName(SEARCH_BOX_ID)[0];
var searchButton = document.getElementsByName(SEARCH_BUTTON_ID)[0];
var luckyButton = document.getElementsByName(LUCKY_BUTTON_ID)[0];
var newButtonSpan = getElementsByClass(document, NEW_BUTTON_SPAN_CLASS, "span")[1];
var searchOptions = document.getElementsByTagName("tr")[1];
//var advancedSearch = document.getElementsByTagName("td")[2];		//Not used at the moment

var homepageLogoURL = NULL_VALUE;
var logoDiv = NULL_VALUE;
var suggestionsTable = EMPTY_VALUE;
var currentSearchSite = GOOGLE_SEARCH_NUMBER;
var searchButtonOriginalText = NULL_VALUE;

if (searchButton != NULL_VALUE)
{
	searchButtonOriginalText = searchButton.value;
}

//Check to see if the element is a DIV not an IMG element
if (homepageLogo.nodeName == DIFFERENT_LOGO_NODENAME)
{
	//Copy the orignal DIV into a variable
	logoDiv = homepageLogo;
}
else
{
	//If not a DIV then retrieve the image source
	homepageLogoURL = homepageLogo.src;
}

//If the logos parent is an "A" (link) we replace it with the logo so that it doesn't interfere with our script
//This is generally associated with Google's Special Doodles
if (homepageLogo.parentNode.nodeName == GOOGLE_DOODLE_WRAPPER)
{
	var parentDiv = homepageLogo.parentNode.parentNode;
	parentDiv.replaceChild(homepageLogo, homepageLogo.parentNode);
}

homepageLogo.setAttribute("onclick", EMPTY_VALUE);		//Removes the logo's onclick event
homepageLogo.addEventListener("click", function (){ changeSearchSite(); }, false);		//Adds a new onclick event to the logo to change search sites

//Adds a keyboard event listner to listen for UP key presses.
var keyPressHandler = function(e){return keyboardSiteChange(searchBox.value, e)};
searchBox.addEventListener("keydown", keyPressHandler, false);

function changeSearchSite()
{
	//Search engine 999 is Google
	if (currentSearchSite == GOOGLE_SEARCH_NUMBER)
	{
		currentSearchSite = 0;
		
		if (searchButton != NULL_VALUE)
		{
			//Disable Google
			searchButton.setAttribute("onclick", EMPTY_VALUE);
			searchButton.setAttribute("type", SEARCH_BUTTON_NEW_TYPE);
			
			luckyButton.style.display = CSS_DISPLAY_NONE;
			luckyButton.setAttribute("type", EMPTY_VALUE);
			
			newButtonSpan.style.display = CSS_DISPLAY_NONE;
		}
		
		//Remove image width and height attributes to stop out logos from distorting
		homepageLogo.setAttribute("width", "");
		homepageLogo.setAttribute("height", "");
		
		//google.com does not have country specific search options
		if (searchOptions != NULL_VALUE)
		{
			searchOptions.style.display = CSS_DISPLAY_NONE;
		}
		
		if (logoDiv != NULL_VALUE)
		{
			//Create a copy of the normal IMG element that Google uses for their logo in other countries
			var newLogo = document.createElement("img");
			newLogo.setAttribute("id", LOGO_ID);
			newLogo.setAttribute("src", EMPTY_VALUE);
			newLogo.setAttribute("width", LOGO_WIDTH);
			newLogo.setAttribute("height", LOGO_HEIGHT);
			
			//Replace the DIV with the IMG element created above
			var parentDiv = logoDiv.parentNode;
			parentDiv.replaceChild(newLogo, logoDiv);
			
			//Since the DIV element has been replced by the IMG, we need to re-get the element and add a click listner
			homepageLogo = document.getElementById(LOGO_ID);
			homepageLogo.addEventListener("click", function (){ changeSearchSite(); }, false);
		}
	
		if (searchSites[currentSearchSite].active == true)
		{
			homepageLogo.setAttribute("src", searchSites[currentSearchSite].logo);
			
			if (searchButton != NULL_VALUE)
			{
				searchButton.setAttribute("value", searchSites[currentSearchSite].buttonText);
				searchButton.addEventListener("click", function (){ search(searchBox.value, "click"); }, false);
			}
			
			var keyPressHandler = function(e){return search(searchBox.value, e)};
			searchBox.addEventListener("keydown", keyPressHandler, false);
		}
		else
		{
			changeSearchSite();
		}
	}
	//All other search engines in the array
	else if (currentSearchSite + 1 < searchSites.length)
	{
		currentSearchSite++;
		
		if (searchSites[currentSearchSite].active == true)
		{
			homepageLogo.setAttribute("src", searchSites[currentSearchSite].logo);
			
			if (searchButton != NULL_VALUE)
			{
				searchButton.setAttribute("value", searchSites[currentSearchSite].buttonText);
				searchButton.addEventListener("click", function (){ search(searchBox.value, "click"); }, false);
			}
			
			var keyPressHandler = function(e){return search(searchBox.value, e)};
			searchBox.addEventListener("keydown", keyPressHandler, false);
		}
		else
		{
			changeSearchSite();
		}
	}
	//Back to Google's search
	else
	{
		currentSearchSite = GOOGLE_SEARCH_NUMBER;
		
		if (logoDiv != NULL_VALUE)
		{
			//Revert the replace done above back to the original DIV
			var parentDiv = homepageLogo.parentNode;
			parentDiv.replaceChild(logoDiv, homepageLogo);
			
			//Re-get the new DIV element
			homepageLogo = document.getElementById(LOGO_ID);
		}
		else
		{
			homepageLogo.setAttribute("src", homepageLogoURL);
		}
		
			if (searchButton != NULL_VALUE)
			{
				searchButton.setAttribute("onclick", SEARCH_BUTTON_ONCLICK);
				searchButton.setAttribute("value", searchButtonOriginalText);
				searchButton.setAttribute("type", SEARCH_BUTTON_TYPE);
			
				luckyButton.style.display = EMPTY_VALUE;
				luckyButton.setAttribute("type", LUCKY_BUTTON_TYPE);
				
				newButtonSpan.style.display = EMPTY_VALUE;
			}
			
			if (searchOptions != NULL_VALUE)
			{
				searchOptions.style.display = EMPTY_VALUE;
			}
	}
	
	searchBox.focus();		//Sets the focus back to the search box
}

function search(query, e)
{
	//If e = click then this search function has been triggered by a click of the search button
	//Or e.keyCode = 13 (Enter key) then this search function has been triggered by the enter key
	//And will not search if search box is empty
	if ((e == "click" || e.keyCode == ENTER_BUTTON_KEYCODE) && query != EMPTY_VALUE)
	{
		//Workaround for google.com. For some reason when pressing enter and having the focus on the search bar
		//Google overides the keyboard capture and still searches Google. This sets the focus to the search button
		//and then searches the website.
		searchBox.blur();
		
		var searchURL = searchSites[currentSearchSite].searchURL;
		searchURL = searchURL.replace(QUERY_TERM, query);
		location.href = searchURL;
	}
}

//Captures the UP key press. On press the search site changes
//Will only change search site if query box is empty. This allows users to navigate Google's suggestions with their keyboard
function keyboardSiteChange(query, e)
{
	if (e.keyCode == UP_ARROW_KEYCODE && query == EMPTY_VALUE)
	{
		changeSearchSite();
	}
	else if (currentSearchSite != GOOGLE_SEARCH_NUMBER && query != EMPTY_VALUE)
	{
		//Retrieve Google's suggestions table if it hasn't been done before
		if (suggestionsTable == EMPTY_VALUE)
		{
			suggestionsTable = document.getElementsByClassName(SUGGESTIONS_TABLE_CLASS)[0];
		}
		
		//Google has a 500 millisecond timer. After 500 milliseconds of the user typing something into the search box
		//Google will start retrieving the suggestions. Therefore we must wait longer than that to capture the returned suggestions
		setTimeout(
			function()
			{
				//Retrieve the suggestions table rows
				var suggestionsRows = suggestionsTable.getElementsByTagName("tr");
				
				//For every row, add a mouseover listener that will display the suggestion you are hovering over in the search box
				//and a click listener that will search for the value that you click on from the suggestion box
				for (i = 0; i < suggestionsRows.length; i++)
				{
					if (suggestionsRows[i].getElementsByTagName("tr").length == 0)
					{
						//The below line can be uncommented if you wish for the search box to be populated with the value of the suggestion 
						//your mouse is currently hovering over
						//suggestionsRows[i].addEventListener("mouseover", function (){ searchBox.value = getNodeValue(this);}, false);
						
						suggestionsRows[i].addEventListener("click", function (){ search(getNodeValue(this), "click"); }, false);
					}
				}
			}, 550)
	}
}

//Retrieves the value of the suggestion
function getNodeValue(row)
{
	var suggestion = EMPTY_VALUE;
	
	var columns = row.getElementsByTagName("td");
	
	//Google.com has both 1 column and 2 column rows with the suggested text
	if (columns.length == 1 || columns.length == 2)
	{
		suggestion = columns[0].firstChild.nodeValue;
		
		if (columns[0].childNodes.length == 2)
		{
			suggestion += columns[0].childNodes[1].firstChild.nodeValue;
		}
	}
	
	return suggestion;
}

//1. Supply a class name as a string.
//2. (optional) Supply a node. This can be obtained by getElementById, or simply by just throwing in “document” 
//   (it will be document if don’t supply a node)). It’s mainly useful if you know your parent and you don’t want to loop through the entire D.O.M.
//3. (optional) Limit your results by adding a tagName. Very useful when you’re toggling checkboxes and etcetera.
//   You could just supply “input“. Or, if you’re like me, and you said Good Bye to IE5, you can use the “*” asterisk as a catch-all (meaning ‘any element).
function getElementsByClass(node, searchClass, tag) 
{
	var classElements = new Array();
	var els = node.getElementsByTagName(tag);
	var elsLen = els.length;
	var pattern = new RegExp("(^|\\s)"+searchClass+"(\\s|$)");
	
	for (i = 0, j = 0; i < elsLen; i++) 
	{
		if ( pattern.test(els[i].className) ) 
		{
			classElements[j] = els[i];
			j++;
		}
	}
	
	return classElements;
}


